import React from 'react';

class Header extends React.Component {

	ololo() {
		console.log('ololo')
	}

	render() {
		return (
			<div className="Header">
				{this.props.pages.map(page => (
					<button key={page} onClick={this.ololo}>
						{page}
					</button>
				))}
			</div>
		);
	}

}

export default Header;
